import './App.css';

function App() {
  return (
    <div style={{height: '100%'}}>
       {/* <Navigation /> */}
       <Toolbar />
       <SideDrawer />
       <Backdrop />
       <Hero />
       {/* <SectionOne />  */}
       {/* <Footer /> */}
    </div>
  );
}

export default App;
